import React from 'react';

import './header.styles.css';


const Header = () => {
    return (
        <nav class="navbar navbar-light bg-light">  
            <div className="container">
                <span className="navbar-brand mb-0 h1">Users List</span>
            </div>
        </nav>
    );
};

export default Header;
